import React, {Component} from 'react';
import './css/bootstrap.css';

class Header extends Component {
	render(){
		return (
		<nav class="navbar navbar-expand-md navbar-dark fixed-top bg-dark">
	    	<div class="navbar-header">
	    		<img src='user_profile.png' height="42" width="42"/>
	            <a class="navbar-brand" href="#">Stockify</a>
	        </div>

	        <div class="collapse navbar-collapse">
	          <ul class="navbar-nav mr-auto">
		        <li class="nav-item active">
		        	<a class="nav-link" href="#">Stock <span class="sr-only">(current)</span></a>
		        </li>
		        <li class="nav-item">
		        	<a class="nav-link" href="#">Porfolio</a>
		        </li>
		        <li class="nav-item">
		        	<a class="nav-link" href="#">Screener</a>
		        </li> 
		        <li class="nav-item">
		        	<a class="nav-link" href="#">Profile</a>
		        </li>
	          </ul>
	        </div>

	    </nav>

		);
	}
}

export default Header;
